import './App.css';
// import 'bootstrap/dist/css/bootstrap.min.css';  // Regular Bootstrap CSS
import '../node_modules/bootstrap-dark-5/dist/css/bootstrap-dark.min.css'; // Dark Bootstrap theme (if used)
import '../node_modules/bootstrap/dist/js/bootstrap.bundle.min.js'; // Bootstrap JavaScript
// import 'bootstrap/dist/css/bootstrap.min.css';
// import 'bootstrap/dist/js/bootstrap.bundle.min';
import '../node_modules/bootstrap-dark-5/dist/css/bootstrap-dark.min.css'

import Home from './screens/Home';
import Login from './screens/Login';
import Signup from './screens/Signup';
import ProfileDahboard from './components/ProfileDahboard';
// import Footer1 from './components/Footer1';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
      <Router>
        <div>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/Signup" element={<Signup />} />
            <Route path="/ProfileDahboard" element={<ProfileDahboard />} />
            {/* <Route path="/Footer1" element={<Footer1/>} /> */}
          </Routes>
        </div>
      </Router>
  );
}

export default App;
